import React from 'react';
import './App.css';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'
import Home from "./pages/Home"

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/home"></Route>
        <Home />
      </Switch>
    </Router>
  );
}

export default App;
